import React, { useState } from "react";
import { AppBar, Tab, Tabs, Toolbar, Typography, List, ListItem, Button } from "@mui/material";
import LibraryBooksOutlinedIcon from "@mui/icons-material/LibraryBooksOutlined";
import { NavLink } from "react-router-dom";
const Header = () => {
  const [value, setValue] = useState();
  return (
    <div>
      <AppBar sx={{ backgroundColor: "#232F3D" }} position="sticky">
        <Toolbar>
          <NavLink to="/" style={{ color: "white" }}>
            <Typography>
              <LibraryBooksOutlinedIcon />
            </Typography>
          </NavLink>
          <Tabs
            sx={{ ml: "auto" }}
            textColor="inherit"
            indicatorColor="primary"
            value={value}
            onChange={(e, val) => setValue(val)}
          >
            <Tab LinkComponent={NavLink} to="/add" label="Add product" />
            <Tab LinkComponent={NavLink} to="/books" label="Books" />
            <Tab LinkComponent={NavLink} to="/about" label="My Profile" />
            <Tab LinkComponent={NavLink} to="/User" label="Users" />
            <Tab LinkComponent={NavLink} to="/Signup" label="Sign up" />
            <Tab LinkComponent={NavLink} to="/login" label="Login" />
          </Tabs>
          {user ? (
            <List sx={{ display: 'flex', alignItems: 'center', ml: 2 }}>
              <ListItem sx={{ padding: 0 }}>
                <Typography variant="body1" sx={{ marginRight: 3, color: 'white' }}>
                  Welcome, {user.username}
                </Typography>
              </ListItem>
              <ListItem sx={{ padding: 0 }}>
                <Button 
                  variant="outlined" 
                  color="secondary" 
                  onClick={handleLogout}
                >
                  Logout
                </Button>
              </ListItem>
            </List>
          ) : null}
        </Toolbar>
      </AppBar>
    </div>
  );
};

export default Header;
